import UseContext from './useContext';

function App() {
  return (
    <div className="App">
      <Counter/>
      <hr></hr>
      <CounterReducer/>
      <hr></hr>
      <TextInputUseRef/>
      <hr></hr>

      <ExpensiveCalculationComponentMemo num={10}/>
      <hr></hr>
      <UseContext/>
      <hr>
      </hr>

    </div>
  );
}

export default App;
